function runUpsell()
{
document.querySelector("div.on-off-btn").classList.toggle('active');

var decision = document.querySelector("div.on-off-btn").classList.contains('active');
if(decision)
{
  if(!document.querySelector('.upsellProduct')){
    document.querySelector("div.on-off-btn").classList.add('buttonactive');
  document.querySelector('#upsellForm button#-submit').click();
  }
}else{
  if(document.querySelector('.upsellProduct button.button.button--tertiary')){
    document.querySelector('.upsellProduct button.button.button--tertiary').click();
    setTimeout(function (){
 document.querySelector("div.on-off-btn").classList.remove('buttonactive');
  },800);
  }
}
}


document.querySelectorAll('a[href^="#"]').forEach(anchor => {
    anchor.addEventListener('click', function (e) {
        e.preventDefault();
        document.querySelector(this.getAttribute('href')).scrollIntoView({
            behavior: 'smooth'
        });
    });
});

$('body .mobile_loc_btn').click(function(){
  var check_aria = $(this).attr('aria-expanded');

  if(check_aria == 'false'){
    $(this).attr('aria-expanded', 'true');
    $(this).parent().find('.disclosure__list-wrapper').removeAttr('hidden');
  }else{
    $(this).attr('aria-expanded', 'false');
    $(this).parent().find('.disclosure__list-wrapper').attr('hidden', 'true');
  }
});